import React from "react";

function Card(props) {
  return (
    <div>
      <div>
        <img src="" alt="" />
        <div>
          <span>{props.item.location}</span>
          <span>
            <a href={props.item.googleMapsUrl}>View on Google Maps</a>
          </span>
          <span>
            {props.item.startDate} - {props.item.endDate}
          </span>
          <p>{props.item.description}</p>
        </div>
      </div>
    </div>
  );
}

export default Card;
